    //     address _patientwalletAddr
    // ) public {
    //     require(msg.sender == admin.HOSPITAL_ADMIN());
    //     allPatients.push(
    //         Patients(
    //             _name,
    //             _perAddr,
    //             _tempAddr,
    //             _phoneNo,
    //             _age,
    //             _sex,
    //             _bloodGroup,
    //             _patientwalletAddr
    //         )
    //     );
    // }

    mapping(address => Patients) allPatients;
    mapping(address => mapping(address => bool)) permittedDoctors;
    struct Patients {
        string name;
        string permanentAddress;
        string temporaryAddress;
        string phoneNumber;
        string age;
        string sex;
        string bloodGroup;
        address createdBy;
    }

    function createPatient(
        string memory _name,
        string memory _permAddr,
        string memory _tempAddr,
        string memory _phoneNo,
        string memory _age,
        string memory _sex,
        string memory _bloodGroup,
        address _patientWalletAddr,
        address _createdBy
    ) public {
        allPatients[_patientWalletAddr] = Patients(
            _name,
            _permAddr,
            _tempAddr,
            _phoneNo,
            _age,
            _sex,
            _bloodGroup,
            _createdBy
        );
    }

    function givePermissionToDoctor(address _patientAddr, address _docAddr)
        public
    {
        permittedDoctors[_patientAddr][_docAddr] = true;
    }

    function hasPermissionToViewRecord(
        address _patientAddress,
        address _doctorAddress
    ) public view returns (bool _hasPermission) {
        _hasPermission = permittedDoctors[_patientAddress][_doctorAddress];
    }
}
